units.statement:
Есть $N$ изделий, $M$ из них бракованные. Вероятность ровно $k$ браков при $n\le N$:
\begin{enumerate}
  \item Модель $w=(i_1,\ldots,i_n)$: $|\Omega|=N^n$,  
        $P(A)=\frac{\binom nk\,M^k(N-M)^{n-k}}{N^n}=\binom nk p^k(1-p)^{n-k}.$
  \item Бернулли-схема $w=(l_1,\ldots,l_n)$, $l_i\in\{0,1\}$, $|\Omega|=2^n$, $p=M/N$;
        $P(\{w\})=p^{\sum l_i}(1-p)^{n-\sum l_i}$ и сумма по всем $w$ равна 1.
\end{enumerate}
